/// 根据索引获取格言
pub fn get_hitokoto(index: usize) -> Option<&'static Hitokoto> {
    HITOKOTOS.get(index)
}

/// 获取格言总数
pub fn hitokoto_count() -> usize {
    HITOKOTOS.len()
}

/// 根据索引获取分类
pub fn get_category(index: usize) -> Option<&'static HitokotoCategory> {
    CATEGORIES.get(index)
}

/// 获取分类总数
pub fn category_count() -> usize {
    CATEGORIES.len()
}

/// 根据字符获取索引
pub fn char_to_index(c: char) -> Option<usize> {
    CHARS.iter().position(|&ch| ch == c)
}

/// 根据索引获取字符
pub fn index_to_char(index: usize) -> Option<char> {
    CHARS.get(index).copied()
}

